import { Router } from 'express';
import './App.css';
import LoginSignup from './components/LoginSignup' ;
import Home from './components/Home';

function App() {
  return (
    <div className='App'>
      <Router>
        <Route path='/'><LoginSignup/></Route>
        <Route path='/home'><Home/></Route>
      </Router>
    </div>
  );
}

export default App;
